export class AppFactory {
  constructor(baseUrl) {
    this._baseUrl = baseUrl || 'http://localhost3000';
    this._links = {
      root: '/'
    };
  }

  get baseUrl () {
    return this._baseUrl;
  }

  get links () {
    return this._links;
  }

  setLink(name, link) {
    this._links[name] = link;
  }

  getFullLink(name) {
    return this._baseUrl + this._links[name]
  }
}
